window.bookSummaryJSON = "<p><b>Rules were made to be broken.</b></p> <p>From terraformed outposts to magical realms, journey to worlds where deadly plants, rampant biodiversity, or failed colonies have created irresistible opportunities for those brave enough to seize them.</p> <p>New worlds, found family, mystical secrets, and deadly science weave together in this lesbian-centric anthology focusing on a very different kind of first time - a first encounter with a world, or being, entirely unlike our own.</p> <p>If you like diverse stories with lesbian heroines practicing science, magic, and seduction, buy <i>Distant Gardens</i> today!</p>"; 
